    return(
      <button type="button" className={style} onClick={handleClick}>
        {text}
      </button>

    )
  }

  return (
    <div className="App">
      <header className="App-header">
          Grace Elias
      </header>
      <section className="button_container">
        <Button style = "home_button" text = "Home" onClick = {handleHomeClick}> </Button>
        <Button style = "resume_button" text = "Resume"></Button>
        <Button style = "projects_button" text = "Projects">Test</Button>
        <Button style = "experience_button" text = "Experience">Test</Button>
        <Button style = "about_me_button" text = "About Me"></Button>
      </section>

      <div className = "home_text">
        Hi! My name is Grace and I'm a computer science student with a mechanical engineering minor at Boston University. Check out my site to learn more about me and my experiences!
      </div>
    </div>

  );
}

export default App;
